import React from 'react';
import {Helmet} from 'react-helmet'
class Home extends React.Component {
    render() {
        return (
            <React.Fragment>
                <Helmet>
                    <title>Inicio</title>
                </Helmet>

            </React.Fragment>

        )
    }
}

export default Home;
